import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function BookList() {
    return (
        <>
            <section className='books'>
                <Book />
            </section>
        </>
    )
}

const image = <img src='https://www.slashfilm.com/wp/wp-content/images/terminator-6-direction.jpg' width='300px' height='250px' alt='' />
const Title = 'Terminator';
const Author = 'James Cameron'


const Book = () => {
    return (
        <article>
            {image}
            <h1>{Title}</h1>
            <h1> {Author.toUpperCase()}</h1>        </article>

    )
}


ReactDOM.render(
    <>
        <BookList />

    </>

    ,
    document.getElementById('root')
)
